import React from 'react'

class Multiplechkbox extends React.Component{
    render(){
        return(
        
        <div> 
            <center>
                <hr/>
                <input type="checkbox" name="Propaganda 1"/>Cricket
                <input type="checkbox" name="Propaganda 2"/>Cricket&nbsp;&nbsp;
                <input type="checkbox" name="Cricket"/>Cricket&nbsp;&nbsp;
                <hr/>
            <div style={{backgroundColor:"black;",color:"cyan"}}>

            </div>

            </center>

        </div>);
    }


}
export default Multiplechkbox;
